            <input id="x-coordinate" style={{ width: "4rem" }}></input>
            <label>{" Y Coordinate: "}</label>
            <input id="y-coordinate" style={{ width: "4rem" }}></input>
            <button onClick={createStore}>{"Create Store"}</button>
        </div>
    )
}
export default Register;
